  namespace: SuperOffice.Threading
  summary: "\nAdd back the item being processed to the end of queue, for a retry attempt\n"
  remarks: "\nThis method is intended to be called from within the <xref href=\"SuperOffice.Threading.AsyncQueueProcessItemAsync%601\" data-throw-if-not-resolved=\"false\"></xref> delegate.\nWhen an item is being processed, it is removed from the queue and added to a currently being processed list.\nWhen processing has been completed, it is removed from this list as well.  When\n<see cref=\"!:WaitForItemsInQueueToBeProcessedAsync\"></see> is calledm, it waits for all items in the queue and items being processed.\nWe thus need to add the item back in the queue, without the internal signaling task comleting, so we ignore retry attempts when waiting.\n"
  syntax:
    content: void Requeue(IAsyncQueueProcessItemContext<DelayedItem<TItem>> context, Task prerequisiteTask)
    parameters:
    - id: context
      type: SuperOffice.Threading.IAsyncQueueProcessItemContext{SuperOffice.Threading.DelayedItem{{TItem}}}
      description: Context that needs the be requeued
    - id: prerequisiteTask
      type: System.Threading.Tasks.Task
      description: Task that must be completed before the item is processed again.
    content.vb: Sub Requeue(context As IAsyncQueueProcessItemContext(Of DelayedItem(Of TItem)), prerequisiteTask As Task)
  overload: SuperOffice.Threading.IDelayedAsyncQueue`1.Requeue*
